import React from 'react'

const mapStateToProps = (state) => {
    return {
      getInventorysList: state.inventorys.getInventorysList,
      errorInventorysList: state.inventorys.errorInventorysList,
    };
  };

const LoginComponent = () => {
    return (
        <div>
            <h1>Login</h1>
        </div>
    )
}

export default connect(mapStateToProps, null)(LoginComponent);
